import React from "react"
import styles from './Dashboard.module.css'

import TopDashboard from "./TopDashboard/TopDashboard"
import ContentDashboard from "./ContentDashboard/ContentDashboard"


const plansData = ['Plan 1', 'Plan2', 'Huinea', 'Potential']

const contentDashboardProps = {
    completedCourses: 17,
    totalCourses: 24,
    courses: {
        polytechnicFoundation: {
            name: 'The polytechnic foundation',
            nrOfCourses: 9,
            nrOfCompletedCourses: 4,    
            color: 'rgb(33 208 130)',
            courses: {
                math1a: {
                    courseNr: '01003',
                    name: 'Mathematics 1a (Polytechnical Foundation)',
                    ects: 10 
                },
                computerProgramming: {
                    courseNr: '02003',
                    name: 'Computer Programming',
                    ects: 5
                },
                fundamentalChemistry: {
                    courseNr: '26020',
                    name: 'Fundamental Chemistry',
                    ects: 5
                },
                physics: {
                    courseNr: '10063',
                    name: 'Physics (Polytechnical Foundation)',
                    ects: 5
                },
                math1b: {
                    courseNr: '01004',
                    name: 'Mathematics 1b (Polytechnical Foundation)',
                    ects: 10
                },
                statistics: {
                    courseNr: '02402',
                    name: 'Statistics (Polytechnical Foundation)',
                    ects: 5
                },
                bioengineering: {
                    courseNr: '27020',
                    name: 'Bioengineering (Polytechnical Foundation)',
                    ects: 5
                },
                scienceTechnologySociety: {
                    courseNr: '42620',
                    name: 'Science, Technology and Society (Polytechnical Foundation)',
                    ects: 5
                }
            }
        }
    }
}


function Dashboard() {
    return (
        <div className={styles.mainView}>
            <TopDashboard plans={plansData} />
            <ContentDashboard {...contentDashboardProps}/>
        </div>
    )
}

export default Dashboard
